import { Component } from "react";
const styles = {
    button: {
        backgroundColor: '#e84328', 
        color: '#3e2623',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer', 
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        fontSize: '16px',
        paddingRight: '25px',
    },
    carro: {
        width:'50px',
    }
}

class Carro extends Component{
    render() {
        return (
            <div>
                <button style={styles.button }><img style={styles.carro } src="/img/carro-de-compras-rapido.png" alt="Carrito de compras" />Comprar</button>
            </div>
        )
    }
}
export default Carro
